import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  Play, 
  Pause, 
  RotateCcw, 
  ArrowLeft,
  Zap,
  Gauge,
  Leaf,
  TrendingUp,
  Clock,
  MapPin,
  Car,
  BarChart3,
  Activity,
  Target
} from 'lucide-react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, AreaChart, Area } from 'recharts';
import './SimulationDashboard.css';

const SimulationDashboard = () => {
  const navigate = useNavigate();
  const [isRunning, setIsRunning] = useState(false);
  const [currentLap, setCurrentLap] = useState(0);
  const [totalLaps, setTotalLaps] = useState(3);
  const [simulationTime, setSimulationTime] = useState(0);
  const [activeTab, setActiveTab] = useState('telemetry');
  
  // Simulation data
  const [simulationData, setSimulationData] = useState({
    ai: {
      lapTime: 0,
      energyConsumption: 0,
      co2Saved: 0,
      speed: 0,
      throttle: 0,
      brake: 0,
      position: { x: 0, y: 0 }
    },
    human: {
      lapTime: 0,
      energyConsumption: 0,
      co2Saved: 0,
      speed: 0,
      throttle: 0,
      brake: 0,
      position: { x: 0, y: 0 }
    }
  });

  // Mock telemetry data
  const [telemetryData, setTelemetryData] = useState([]);
  const [heatmapData, setHeatmapData] = useState([]);

  useEffect(() => {
    // Load simulation config
    const config = JSON.parse(localStorage.getItem('simulationConfig') || '{}');
    if (!config.track) {
      navigate('/simulator');
      return;
    }

    // Initialize mock data
    generateMockData();
  }, [navigate]);

  const generateMockData = () => {
    const data = [];
    for (let i = 0; i < 100; i++) {
      data.push({
        time: i * 0.1,
        aiSpeed: 50 + Math.sin(i * 0.1) * 30 + Math.random() * 10,
        humanSpeed: 45 + Math.sin(i * 0.1) * 25 + Math.random() * 15,
        aiThrottle: Math.max(0, Math.min(100, 50 + Math.sin(i * 0.1) * 30)),
        humanThrottle: Math.max(0, Math.min(100, 60 + Math.sin(i * 0.1) * 25)),
        aiBrake: Math.max(0, Math.min(100, 20 + Math.sin(i * 0.1) * 15)),
        humanBrake: Math.max(0, Math.min(100, 30 + Math.sin(i * 0.1) * 20)),
        aiEnergy: i * 0.5 + Math.random() * 2,
        humanEnergy: i * 0.7 + Math.random() * 3
      });
    }
    setTelemetryData(data);
  };

  const startSimulation = () => {
    setIsRunning(true);
    // Simulate real-time data updates
    const interval = setInterval(() => {
      setSimulationTime(prev => prev + 0.1);
      setSimulationData(prev => ({
        ai: {
          ...prev.ai,
          lapTime: prev.ai.lapTime + 0.1,
          speed: 80 + Math.random() * 40,
          throttle: Math.random() * 100,
          brake: Math.random() * 50
        },
        human: {
          ...prev.human,
          lapTime: prev.human.lapTime + 0.1,
          speed: 75 + Math.random() * 35,
          throttle: Math.random() * 100,
          brake: Math.random() * 60
        }
      }));
    }, 100);

    // Stop simulation after 30 seconds
    setTimeout(() => {
      clearInterval(interval);
      setIsRunning(false);
      navigate('/results');
    }, 30000);
  };

  const pauseSimulation = () => {
    setIsRunning(false);
  };

  const resetSimulation = () => {
    setIsRunning(false);
    setSimulationTime(0);
    setCurrentLap(0);
    setSimulationData({
      ai: { lapTime: 0, energyConsumption: 0, co2Saved: 0, speed: 0, throttle: 0, brake: 0, position: { x: 0, y: 0 } },
      human: { lapTime: 0, energyConsumption: 0, co2Saved: 0, speed: 0, throttle: 0, brake: 0, position: { x: 0, y: 0 } }
    });
  };

  const formatTime = (seconds) => {
    const mins = Math.floor(seconds / 60);
    const secs = (seconds % 60).toFixed(1);
    return `${mins}:${secs.padStart(4, '0')}`;
  };

  const tabs = [
    { id: 'telemetry', label: 'Telemetry Data', icon: Activity },
    { id: 'heatmap', label: 'Driving Heatmaps', icon: Target },
    { id: 'insights', label: 'Model Insights', icon: BarChart3 }
  ];

  return (
    <div className="simulation-dashboard">
      <div className="dashboard-container">
        {/* Header */}
        <motion.div 
          className="dashboard-header"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <div className="header-left">
            <Link to="/simulator" className="back-button">
              <ArrowLeft size={20} />
              Back to Setup
            </Link>
            <div className="simulation-info">
              <h1>Live Simulation</h1>
              <div className="simulation-meta">
                <span><MapPin size={16} /> Silverstone Circuit</span>
                <span><Car size={16} /> Eco Mode</span>
                <span><Clock size={16} /> {formatTime(simulationTime)}</span>
              </div>
            </div>
          </div>
          
          <div className="header-controls">
            <button 
              className={`control-btn ${isRunning ? 'pause' : 'play'}`}
              onClick={isRunning ? pauseSimulation : startSimulation}
            >
              {isRunning ? <Pause size={20} /> : <Play size={20} />}
              {isRunning ? 'Pause' : 'Start'}
            </button>
            <button className="control-btn reset" onClick={resetSimulation}>
              <RotateCcw size={20} />
              Reset
            </button>
          </div>
        </motion.div>

        {/* Progress Bar */}
        <motion.div 
          className="progress-section"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.1 }}
        >
          <div className="lap-progress">
            <div className="progress-info">
              <span>Lap {currentLap + 1} of {totalLaps}</span>
              <span>{Math.round((currentLap / totalLaps) * 100)}% Complete</span>
            </div>
            <div className="progress-bar">
              <div 
                className="progress-fill"
                style={{ width: `${(currentLap / totalLaps) * 100}%` }}
              />
            </div>
          </div>
        </motion.div>

        {/* Main Content */}
        <div className="dashboard-content">
          {/* Track Visualization */}
          <motion.div 
            className="track-section"
            initial={{ opacity: 0, x: -20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5, delay: 0.2 }}
          >
            <div className="track-visualization">
              <div className="track-map">
                <svg viewBox="0 0 400 300" className="track-svg">
                  {/* Track outline */}
                  <path
                    d="M50 150 Q100 50 200 50 Q300 50 350 150 Q300 250 200 250 Q100 250 50 150"
                    fill="none"
                    stroke="rgba(255, 255, 255, 0.2)"
                    strokeWidth="8"
                    strokeLinecap="round"
                  />
                  
                  {/* AI racing line */}
                  <path
                    d="M50 150 Q100 50 200 50 Q300 50 350 150 Q300 250 200 250 Q100 250 50 150"
                    fill="none"
                    stroke="#00ff88"
                    strokeWidth="3"
                    strokeDasharray="5,5"
                    opacity="0.7"
                  />
                  
                  {/* Human racing line */}
                  <path
                    d="M50 150 Q110 60 200 60 Q290 60 350 150 Q290 240 200 240 Q110 240 50 150"
                    fill="none"
                    stroke="#ff6b35"
                    strokeWidth="3"
                    strokeDasharray="5,5"
                    opacity="0.7"
                  />
                  
                  {/* AI Car */}
                  <circle cx="200" cy="150" r="8" fill="#00ff88" className="car-ai">
                    <animateTransform
                      attributeName="transform"
                      type="rotate"
                      values="0 200 150; 360 200 150"
                      dur="10s"
                      repeatCount="indefinite"
                    />
                  </circle>
                  
                  {/* Human Car */}
                  <circle cx="200" cy="160" r="8" fill="#ff6b35" className="car-human">
                    <animateTransform
                      attributeName="transform"
                      type="rotate"
                      values="0 200 160; 360 200 160"
                      dur="12s"
                      repeatCount="indefinite"
                    />
                  </circle>
                </svg>
              </div>
              
              <div className="track-legend">
                <div className="legend-item">
                  <div className="legend-color ai"></div>
                  <span>AI Driver</span>
                </div>
                <div className="legend-item">
                  <div className="legend-color human"></div>
                  <span>Human Driver</span>
                </div>
              </div>
            </div>
          </motion.div>

          {/* Metrics Panel */}
          <motion.div 
            className="metrics-section"
            initial={{ opacity: 0, x: 20 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.5, delay: 0.3 }}
          >
            <div className="metrics-grid">
              {/* AI Metrics */}
              <div className="metric-group ai-metrics">
                <h3>AI Driver</h3>
                <div className="metric-cards">
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Clock size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{formatTime(simulationData.ai.lapTime)}</div>
                      <div className="metric-label">Lap Time</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Zap size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{(simulationData.ai.energyConsumption).toFixed(1)} kWh</div>
                      <div className="metric-label">Energy Used</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Leaf size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">-{simulationData.ai.co2Saved.toFixed(1)}%</div>
                      <div className="metric-label">CO₂ Saved</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Gauge size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{Math.round(simulationData.ai.speed)} km/h</div>
                      <div className="metric-label">Speed</div>
                    </div>
                  </div>
                </div>
              </div>

              {/* Human Metrics */}
              <div className="metric-group human-metrics">
                <h3>Human Driver</h3>
                <div className="metric-cards">
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Clock size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{formatTime(simulationData.human.lapTime)}</div>
                      <div className="metric-label">Lap Time</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Zap size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{(simulationData.human.energyConsumption).toFixed(1)} kWh</div>
                      <div className="metric-label">Energy Used</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Leaf size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">-{simulationData.human.co2Saved.toFixed(1)}%</div>
                      <div className="metric-label">CO₂ Saved</div>
                    </div>
                  </div>
                  
                  <div className="metric-card">
                    <div className="metric-icon">
                      <Gauge size={20} />
                    </div>
                    <div className="metric-content">
                      <div className="metric-value">{Math.round(simulationData.human.speed)} km/h</div>
                      <div className="metric-label">Speed</div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        </div>

        {/* Tabs Section */}
        <motion.div 
          className="tabs-section"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5, delay: 0.4 }}
        >
          <div className="tabs-header">
            {tabs.map((tab) => {
              const Icon = tab.icon;
              return (
                <button
                  key={tab.id}
                  className={`tab-button ${activeTab === tab.id ? 'active' : ''}`}
                  onClick={() => setActiveTab(tab.id)}
                >
                  <Icon size={18} />
                  {tab.label}
                </button>
              );
            })}
          </div>
          
          <div className="tabs-content">
            {activeTab === 'telemetry' && (
              <div className="telemetry-content">
                <div className="chart-grid">
                  <div className="chart-card">
                    <h4>Speed Comparison</h4>
                    <ResponsiveContainer width="100%" height={200}>
                      <LineChart data={telemetryData}>
                        <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                        <XAxis dataKey="time" stroke="rgba(255, 255, 255, 0.6)" />
                        <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                        <Tooltip 
                          contentStyle={{ 
                            backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                            border: '1px solid rgba(255, 255, 255, 0.2)',
                            borderRadius: '8px'
                          }}
                        />
                        <Line type="monotone" dataKey="aiSpeed" stroke="#00ff88" strokeWidth={2} />
                        <Line type="monotone" dataKey="humanSpeed" stroke="#ff6b35" strokeWidth={2} />
                      </LineChart>
                    </ResponsiveContainer>
                  </div>
                  
                  <div className="chart-card">
                    <h4>Energy Consumption</h4>
                    <ResponsiveContainer width="100%" height={200}>
                      <AreaChart data={telemetryData}>
                        <CartesianGrid strokeDasharray="3 3" stroke="rgba(255, 255, 255, 0.1)" />
                        <XAxis dataKey="time" stroke="rgba(255, 255, 255, 0.6)" />
                        <YAxis stroke="rgba(255, 255, 255, 0.6)" />
                        <Tooltip 
                          contentStyle={{ 
                            backgroundColor: 'rgba(0, 0, 0, 0.8)', 
                            border: '1px solid rgba(255, 255, 255, 0.2)',
                            borderRadius: '8px'
                          }}
                        />
                        <Area type="monotone" dataKey="aiEnergy" stackId="1" stroke="#00ff88" fill="#00ff88" fillOpacity={0.3} />
                        <Area type="monotone" dataKey="humanEnergy" stackId="2" stroke="#ff6b35" fill="#ff6b35" fillOpacity={0.3} />
                      </AreaChart>
                    </ResponsiveContainer>
                  </div>
                </div>
              </div>
            )}
            
            {activeTab === 'heatmap' && (
              <div className="heatmap-content">
                <div className="heatmap-grid">
                  <div className="heatmap-card">
                    <h4>AI Driver Heatmap</h4>
                    <div className="heatmap-visualization">
                      <div className="heatmap-placeholder">
                        <Target size={48} />
                        <p>Driving pattern heatmap visualization</p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="heatmap-card">
                    <h4>Human Driver Heatmap</h4>
                    <div className="heatmap-visualization">
                      <div className="heatmap-placeholder">
                        <Target size={48} />
                        <p>Driving pattern heatmap visualization</p>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            )}
            
            {activeTab === 'insights' && (
              <div className="insights-content">
                <div className="insights-grid">
                  <div className="insight-card">
                    <h4>AI Decision Making</h4>
                    <div className="insight-content">
                      <p>The AI model is optimizing for:</p>
                      <ul>
                        <li>Energy efficiency over raw speed</li>
                        <li>Smooth acceleration patterns</li>
                        <li>Early braking for corner entry</li>
                        <li>Optimal gear selection</li>
                      </ul>
                    </div>
                  </div>
                  
                  <div className="insight-card">
                    <h4>Performance Analysis</h4>
                    <div className="insight-content">
                      <p>Key differences observed:</p>
                      <ul>
                        <li>AI uses 15% less energy</li>
                        <li>More consistent lap times</li>
                        <li>Better cornering efficiency</li>
                        <li>Reduced tire wear simulation</li>
                      </ul>
                    </div>
                  </div>
                </div>
              </div>
            )}
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default SimulationDashboard;
